import React from "react";
import { Route, Routes } from "react-router-dom";
import { Login } from '../src/auth/Login.js';
import { Register } from '../src/auth/Register';
import { Nav } from './components/Nav.js';

 function App() {
  return (
    <>
    <Nav/>
    <Routes>
      <Route path="/" element={<Login/>}/>
    </Routes>

    </>
  );
}
export default App;
